package com.example.kotlinyelp.data

import androidx.lifecycle.LiveData
import androidx.lifecycle.MutableLiveData
import com.example.kotlinyelp.BuildConfig
import com.example.kotlinyelp.api.api
import io.reactivex.Single

class BusinessDao {
    private val businessList = mutableListOf<Business>()
    private val businesses = MutableLiveData<List<Business>>()
    private var currentTerm: String? = null

    private fun populateFakeData(): Unit {
        val location = Location("Mountain View", "California")
        val alias = "To get real data from Yelp\nbuild this app with your own Yelp Api Key from\nhttps://www.yelp.com/developers\nadd a line in\n~/.gradle/gradle.properties\nYELP_API_KEY=[your yelp api key]"
        businessList.add(Business("Cupcake", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Donut", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Eclair", location, alias,"data:image/png;base64,"))
        businessList.add(Business("Froyo", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Gingerbread", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Honeycomb", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Ice Cream Sandwich", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Jelly Bean", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Kitkat", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Lollipop", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Marshmallow", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Nougat", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Oreo", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Pie", location, alias,"data:image/jpeg;base64,"))
        businessList.add(Business("Q", location, alias,"data:image/png;base64,"))
        businesses.value = businessList
    }

    fun getBusiness(pos: Int): Business {
        return businessList[pos]
    }

    private fun isCached(term: String): Boolean {
        synchronized(lock = businessList) {
            return currentTerm != null && currentTerm.equals(term)
        }
    }

    private fun cache(term: String): Unit {
        currentTerm = term
        synchronized(lock = businessList) {
            currentTerm = term
        }
    }

    fun getBusinesses(term: String): LiveData<List<Business>> {
        if (BuildConfig.YELP_API_KEY.isEmpty()) {
            populateFakeData()
            return businesses
        }

        if (isCached(term)) {
            return businesses
        }

        currentTerm = term
        val res: Single<BusinessSearchResponse> = api<BusinessSearch>().search(term)
        res.subscribe { list, _ ->
            businessList.clear()
            if ((list?.total ?: 0) > 0) {
                for (business in list.businesses) {
                    businessList.add(business)
                }
            }
            businesses.value = businessList
            cache(term)
        }
        return businesses
    }
}